import React from 'react';

const PropsCompo2 = (props) => {
    let name=props.name;
    let age=props.age;
    let addr=props.addr;
    return (
        <div className="PropsCompo2">
            <strong>PropsCompo2 속성을 갖는 컴포넌트</strong>
            <p>
                이름 : {name}<br/>
                나이 : {age}<br/>
                주소 : {addr}<br/>
            </p>
        </div>
    );
};

export default PropsCompo2;
